import React from "react";
import Detail from "../../data/detail.json";
const DelailList = (props) => {
  return (
    <div>
      <div>
        <h1>{Detail.name}</h1>
        <button>Reserve or Book Now</button>
      </div>
      <p>{Detail.address}</p>
      <h4>{Detail.distance}</h4>
      <h4>{Detail.price}</h4>
      <div>
        {props.photos.map((coll, index) => (
          <img src={coll.photos} alt={Detail.photos.index}></img>
        ))}
      </div>
      <h1>{Detail.title}</h1>
      <p>{Detail.description}</p>
    </div>
  );
};
export default DelailList;
